import { Box, Typography } from "@mui/material";
import React from "react";
import EditIcon from "../assets/location/EditIcon";
import AppBarTop from "../components/AppBarTop";
import { PADDING } from "../constants/Padding";
import { THEME } from "../constants/Theme";
import { useNavigate } from "react-router-dom";
import BasketIcon from "../assets/product/BasketIcon";
import Beras from "../assets/product/Beras.png";


function Product() {
  const navigate = useNavigate()

  return (
    <Box
      sx={{
        width: "100%",
        display: "flex",
        flexDirection: "column",
        justifyContent: "flex-start",
        alignItems: "center",
      }}
    >
      <AppBarTop text={"Daftar Alamat"} line addBasket/>
      <Box sx={{marginTop:"18px"}}>
      <img src={Beras} alt="product" width={"340px"} height={"247px"} />
      <Typography sx={{fontSize: '18px', fontWeight: 500}}>Beras Organik</Typography>
      <Box sx={{display: 'flex', mt: '7px'}}>
        <Box sx={{backgroundColor: "#f04454", width: '30px', height: '19px', borderRadius: '4px', display: 'flex', justifyContent: 'center', alignItems: 'center'}}>
            <Typography sx={{color: 'white', fontSize: '10px', fontWeight: 600}}>20%</Typography>
        </Box>
        <Typography></Typography>
      </Box>
      </Box>

    </Box>
  );
}

export default Product;
